ize.	initialCount _ (d * self samplingRate asFloat) rounded.	originalSamplingRate _		((self samplingRate asFloat * p asFloat) / NominalSamplePitch asFloat) asInteger.	self loudness: vol.	self reset.! !!SampledSound methodsFor: 'initialization' stamp: 'jm 3/29/1999 10:41'!setSamples: anArray samplingRate: rate	"Set my samples array to the given array with the given nominal sampling rate. Altering the rate parameter allows the sampled sound to be played back at different pitches."	"Assume: anArray is either a SoundBuffer or a collection of signed 16-bit sample values."	"(SampledSound		samples: SampledSound coffeeCupClink		samplingRate: 5000) play"	"copy the array into a SoundBuffer if necessary"	anArray class isWords		ifTrue: [samples _ anArray]		ifFalse: [samples _ SoundBuffer fromArray: anArray].	samplesSize _ samples size.	originalSamplingRate _ rate.	initialCount _ (samplesSize * self samplingRate) // originalSamplingRate.	self loudness: 1.0.	self reset.! !!SoundCodec methodsFor: 'compress/decompress' stamp: 'jm 3/30/1999 08:03'!decompressSound: aCompressedSound	"Decompress the entirety of the given compressed sound with this codec and answer the resulting sound."	| channels sound |	channels _ aCompressedSound channels		collect: [:compressed | self decodeCompressedData: compressed].	'SampledSound' = aCompressedSound soundClassName ifTrue: [		sound _ SampledSound			samples: channels first			samplingRate: (aCompressedSound samplingRate).		sound loudness: aCompressedSound gain.		^ sound].	'LoopedSampledSound' = aCompressedSound soundClassName ifTrue: [		aCompressedSound loopLength = 0			ifTrue: [				sound _ LoopedSampledSound					unloopedSamples: channels first					pitch: aCompressedSound perceivedPitch					samplingRate: aCompressedSound samplingRate]			ifFalse: [				sound _ LoopedSampledSound					samples: channels first					loopEnd: aCompressedSound loopEnd					loopLength: aCompressedSound loopLength					pitch: aCompressedSound perceivedPitch					samplingRate: aCompressedSound samplingRate].		channels size > 1 ifTrue: [sound rightSamples: channels last].		sound			firstSample: aCompressedSound firstSample;			gain: aCompressedSound gain.		sound			setPitch: 100.0			dur: (channels first size / aCompressedSound samplingRate)			loudness: 1.0.		^ sound].	self error: 'unknown sound class'.! !!ADPCMCodec methodsFor: 'all' stamp: 'jm 3/30/1999 08:56'!decodeFlash: aByteArray sampleCount: sampleCount stereo: stereoFlag	| bits |	encodedBytes _ aByteArray.	byteIndex _ 0.	bitPosition _ 0.	currentByte _ 0.	bits _ 2 + (self nextBits: 2).  "bits per sample"	self initializeForBitsPerSample: bits samplesPerFrame: 4096.	stereoFlag		ifTrue: [			self resetForStereo.			samples _ SoundBuffer newMonoSampleCount: sampleCount.			rightSamples _ SoundBuffer newMonoSampleCount: sampleCount.			sampleIndex _ 0.			self privateDecodeStereo: sampleCount.			^ Array with: samples with: rightSamples]		ifFalse: [			samples _ SoundBuffer newMonoSampleCount: sampleCount.			sampleIndex _ 0.			self privateDecodeMono: sampleCount.			^ Array with: samples].! !AIFFFileReader removeSelector: #play!AIFFFileReader removeSelector: #playLoudness:!AbstractSound removeSelector: #setLoudness:!SampledInstrument removeSelector: #tempTest!